import React from "react";

const Book = (props) => {
    return(
        <li>
            <div>
                <h2>{props.title}</h2>
                <div>{props.author}</div>
                <div>{props.publicationDate}</div>
                <div>{props.genre}</div>
            </div>
        </li>
    )
}

export default Book;
